import pytest
from modules.face_mapper import Mapper


@pytest.mark.parametrize("network, name, image", [("google-plus", "will smith", "")])
def test_mapper(network, name, image):
    OBJ = Mapper()
    response = OBJ.convertor(network, name, image)
    print(response)

    for i in response:

        try:
            assert type(i['following']) == int
        except KeyError:
            pass

        try:
            assert type(i['followers']) == int
        except KeyError:
            pass

        try:
            assert type(i['posts']) == int
        except KeyError:
            pass

        try:
            assert type(i['verified']) == bool
        except KeyError:
            pass

        assert i['url'].startswith('http')
        assert i['image'].startswith('http')
        assert type(i['userid']) == str
        assert i['userid'] != ""

        try:
            try:
                assert type(i['linked_url']) == str
                assert i['linked_url'].startswith('http')
                assert i['linked_url'] != ""
            except:
                pass

        except AssertionError:
            assert i['linked_url'] is None

        try:
            assert type(i['description']) == str
            assert i['description'] != ""
        except AssertionError:
            assert i['description'] is None

        try:
            assert type(i['name']) == str
            assert i['name'] != ""
        except AssertionError:
            assert i['name'] is None

        assert i['type'] == 'identity'
        assert isinstance(i['threshold'], float)


